import React from "react";
import logo from "./logo.svg";
import "./App.css";
import TechComponent from "./components/Tech";
import IntroComponent from "./components/Intro";

function App() {
  return (
    <div className="App">
      <IntroComponent />
      <TechComponent />
    </div>
  );
}

export default App;
